import React from "react";

class Users extends React.Component {
  users = [

  ]
  render() {
    if (this.users.length > 0)
  return (
      <div>
        {this.users.map((e) => (<div key={e.id}>
              <div className="bg-users">
                  <h5>{e.firstname} {e.lastname} (возраст {e.age} лет)</h5>
              <p>{e.bio}</p>  </div>
          </div>))}
      </div>
  )
  else {
    return (
      <div>
        {this.users.map((e) => (<div key={e.id}>
              <div className="bg-users">
                  Все уехали  </div>
          </div>))}
      </div>
  )
  }
}
}

export default Users
